class huffman_table:
    def __init__(self, tbl_type, tbl_idx, treelen, xlen, ylen, linbits, values):
        self.tbl_type = tbl_type        
        self.treelen  = treelen        
        self.xlen     = xlen 
        self.ylen     = ylen
        self.linbits  = linbits
        self.linmax   = (1<<linbits)-1
        self.values   = []
        for i in xrange(treelen):
            self.values.append( (values[2*i+0], values[2*i+1]) )        

        ht_list[tbl_idx] = self


